INSERT INTO `aboutus` (`id`, `title`, `description`, `about_image`, `sortnumber`, `modified_datetime`, `modified_by`) VALUES
(1, 'Tentang FixcoMart', '<p>Macaroon marshmallow chupa chups macaroon chocolate bar sugar plum sesame snaps lemon drops. Bonbon marzipan toffee cheesecake topping brownie gummi bears sesame snaps cupcake. Jelly fruitcake cake lemon drops cookie pastry drag&eacute;e cake. Cookie brownie candy tiramisu candy gingerbread. Sweet roll powder sweet roll. Apple pie sweet gingerbread liquorice biscuit lollipop. Jelly-o lollipop jelly-o chupa chups jelly beans oat cake liquorice lemon drops halvah. Candy canes jelly fruitcake cake lollipop dessert drag&eacute;e marzipan. Cookie liquorice gingerbread sweet powder.</p>\r\n\r\n<p>Macaroon toffee candy macaroon caramels halvah dessert cupcake. Donut lemon drops wafer tart caramels jelly beans cake icing. Powder cotton candy sesame snaps. Caramels bear claw dessert gummies cheesecake pie pastry brownie. Chocolate gummi bears tootsie roll brownie powder wafer. Croissant jelly beans donut brownie. Chocolate bar sesame snaps macaroon chocolate cake dessert cookie muffin muffin. Jelly beans fruitcake cake gingerbread jelly beans. Drag&eacute;e candy canes jelly sweet cupcake croissant pastry apple pie. Sweet roll sweet roll jelly chocolate bar. Tootsie roll drag&eacute;e dessert pudding donut. Cupcake marzipan chupa chups croissant candy canes liquorice chocolate bar chocolate cake oat cake. Liquorice jelly beans icing. Caramels ice cream tootsie roll jelly beans toffee sesame snaps. Pudding caramels brownie carrot cake caramels pastry.</p>\r\n\r\n<p>Brownie chupa chups pie sweet roll pie. Chocolate cake oat cake macaroon drag&eacute;e sweet roll pie dessert caramels icing. Chocolate jelly-o sweet souffl&eacute; sugar plum chocolate topping cupcake. Sweet sugar plum pie. Ice cream candy sesame snaps. Apple pie cake bear claw muffin croissant cotton candy. Danish lemon drops cotton candy tootsie roll tootsie roll halvah sugar plum cheesecake bear claw. Donut marzipan danish gingerbread liquorice souffl&eacute; sugar plum biscuit. Jelly-o tart gingerbread biscuit.</p>\r\n', 'tentang-fixcomartabout-image-2016-02-22-112649.jpg', 1, '2016-02-22 11:26:49', 1);
