INSERT INTO `cara_register_corporate` (`id`, `title`, `description`, `image`, `publish`, `sortnumber`, `modified_datetime`, `modified_by`) VALUES
(4, 'Register Akun Anda', '<p>Macaroon chocolate cake sesame snaps powder candy canes powder toffee. Croissant liquorice fruitcake caramels jujubes biscuit souffl&eacute; jelly. Toffee donut icing sweet roll chocolate cake.</p>\r\n', 'register-akun-andaimage-2016-03-08-165039.png', 1, 1, '2016-03-08 16:50:39', 1),
(5, 'Upgrade Akun Anda', '<p>Macaroon chocolate cake sesame snaps powder candy canes powder toffee. Croissant liquorice fruitcake caramels jujubes biscuit souffl&eacute; jelly. Toffee donut icing sweet roll chocolate cake.</p>\r\n', 'upgrade-akun-andaimage-2016-03-08-165058.png', 1, 2, '2016-03-08 16:50:58', 1),
(6, 'NPWP Perusahaan Anda', '<p>Macaroon chocolate cake sesame snaps powder candy canes powder toffee. Croissant liquorice fruitcake caramels jujubes biscuit souffl&eacute; jelly. Toffee donut icing sweet roll chocolate cake.</p>\r\n', 'npwp-perusahaan-andaimage-2016-03-08-165116.png', 1, 3, '2016-03-08 16:51:16', 1),
(7, 'Masukkan Deposito Akun Anda', '<p>Pie cotton candy cotton candy jelly-o pudding powder cake. Candy halvah chupa chups sugar plum topping biscuit powder sesame snaps. Carrot cake sweet roll jelly-o sweet roll bear claw bear claw chocolate. Donut jelly-o danish topping powder.</p>\r\n', 'masukkan-deposito-akun-andaimage-2016-03-08-165142.png', 1, 4, '2016-03-08 16:51:42', 1),
(8, 'Transfer Dana Deposito Anda', '<p>Carrot cake cookie drag&eacute;e marzipan. Macaroon pudding tart muffin sweet tiramisu pie liquorice sugar plum. Chocolate bar sesame snaps cotton candy lemon drops candy cookie bonbon.</p>\r\n', 'transfer-dana-deposito-andaimage-2016-03-08-165258.png', 1, 5, '2016-03-08 16:52:58', 1),
(9, 'Saatnya Berbelanja di Fixco Mart', '<p>Chocolate bar jelly apple pie cookie ice cream chocolate. Candy souffl&eacute; carrot cake croissant fruitcake. Danish marzipan liquorice apple pie cheesecake.</p>\r\n', 'saatnya-berbelanja-di-fixco-martimage-2016-03-08-165312.png', 1, 6, '2016-03-08 16:53:12', 1);
